import React from "react";
import Home from "./Home";

export const CrudContext = React.createContext()
export default function App() {
  const T = ['name','categorie','prix','quanity']
  return(
    <CrudContext.Provider value={T}>
      <Home/>
    </CrudContext.Provider>
  )
}
